import { Modal, ModalHeader, ModalBody } from 'reactstrap'

export default (props) => {

    const { 
      modalIsOpen, tHead, children,
    } = props

    return (
        <Modal isOpen={props.modalIsOpen} toggle={props.toggleModal} className={props.classNameModal} style={props.styleModal} size={props.sizeModal}>
          <ModalHeader toggle={props.toggle}>{props.titleModalHeader}</ModalHeader>
          <ModalBody>
            {children}
          </ModalBody>
        </Modal>
    )
}
